import React, { useState } from 'react';
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import Stack from "@mui/material/Stack";
import TextField from "@mui/material/TextField";
import OutlinedInput from '@mui/material/OutlinedInput';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';

const [bank, setBank] = React.useState('');

  const handleChange = (event) => {
    setBank(event.target.value);
  };


const Transaction = () => {
  return (
    <>
    <Box sx={{ flexGrow: 1}}>
      <AppBar position="sticky" sx={{ bgcolor: '#F27C22', border: '2px solid #000000', }}>
        <Toolbar>
            <Typography variant="h5" component="div" sx={{ flexGrow: 1, fontWeight: 'bold', color:'black'}}>
              E-BILLING APP
            </Typography>
            <Typography variant="h7" component="div" sx={{ flexGrow: -10, fontWeight: 'bold', color:'black'}}>
              PAYBILLS SECTION
            </Typography>
        </Toolbar>
      </AppBar>
    </Box>

    <Stack spacing={2} direction="row" sx={{paddingLeft: '20%', paddingTop: 10}}>
      <Button variant="contained" sx={{bgcolor: '#F27C22', color: 'Black', border: '2px solid #000000',}}>Back</Button>
      </Stack>
      <Box
        sx={{
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
          justifyContent: 'center',
          height: '45vh',
          border: '2px solid #000000',
          width: '25%',
          margin: '35px auto', // Adjust margin as needed
          padding: '20px',
        }}
      >
        <TextField label="Amount" variant="outlined" type='amount' margin="normal" fullWidth sx={{}} />
        <TextField label="Account No. (10-digits)" variant="outlined" type="accNumber" margin="normal" fullWidth />
        <TextField label="Account Name" variant="outlined" type="accName" margin="normal" fullWidth />

        <Box sx={{ minWidth: 120 }}>
      <FormControl fullWidth>
        <InputLabel id="demo-simple-select-label">Age</InputLabel>
        <Select
          labelId="demo-simple-select-label"
          id="demo-simple-select"
          value={bank}
          label="Age"
          onChange={handleChange}
        >
          <MenuItem value={10}>Ten</MenuItem>
          <MenuItem value={20}>Twenty</MenuItem>
          <MenuItem value={30}>Thirty</MenuItem>
        </Select>
      </FormControl>
    </Box>

        <Button variant="contained" sx={{bgcolor: '#F27C22', color: 'Black', border: '2px solid #000000', margin: '20px auto'}}>Back</Button>
      </Box>

    </>
  )
}

export default Transaction
